import styled from "styled-components";



export const HeaderStyled = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: baseline;
`;

export const MenuIcon = styled(Hamburger)`
fill: #333D4B;
width: 16px;
height: 15px;
`
